export class AsyncContent {
    ionViewWillLoad() {
        return this.fetchNewContent();
    }
    fetchNewContent() {
        return fetch(this.documentLocation)
            .then(response => response.text())
            .then(data => {
            this.content = data;
        });
    }
    render() {
        return (h("div", { innerHTML: this.content }));
    }
    static get is() { return "stencil-async-content"; }
    static get properties() { return { "content": { "state": true }, "doc": { "type": "Any", "attr": "doc", "watchCallbacks": ["fetchNewContent"] }, "documentLocation": { "type": String, "attr": "document-location" } }; }
}
